import React from "react";

export default function FlashCards(props){

    return(
        <div id='flashCards'>
            <div>
            <h2>{props.titulo}</h2>
            </div>
            <hr></hr>
            <p>{props.descricao}</p>
            <img className='imagem' src={props.img}/>
        </div>
    )
}
